import Card from 'react-bootstrap/Card';


const EventList = ({ events }) => {
  return (
    events.map((eve) => (
      <Card bkey={eve.id}
      >
        <div>
          <p>{eve.type}</p>
          <p>{eve.date}</p>
        </div>
        <div>
          <h2>{eve.title}</h2>
        </div>
        <div>
          <p>{eve.description}</p>
        </div>
        <div>
          <p>Location: {eve.location}</p>
          <p>Time: {eve.time}</p>
        </div>
        <button>Delete</button>
      </Card>
    ))
  );
}

export default EventList;
